import { useState } from "react"
import { Container, Nav, Navbar } from './react-bootstrap';
import './App.css';
import mg from './data.js';
import { Routes, Route, Link } from 'react-router-dom'


function App() {

  let [MG] = useState(mg)

  return (
    <div className="App">

      <Navbar bg="dark" data-bs-theme="dark">
              <Container>
                <Navbar.Brand href="#home">GundShop</Navbar.Brand>
                <Nav className="me-auto">
                  <Nav.Link href="#home">로그인</Nav.Link>
                  <Nav.Link href="#features">회원가입</Nav.Link>
                  <Nav.Link href="#pricing">마이페이지</Nav.Link>
                  <Nav.Link href="#pricing">장바구니</Nav.Link>
                  <Nav.Link href="#pricing">고객센터</Nav.Link>
                </Nav>
              </Container>
      </Navbar>

      <Routes>
        <Route path="/" element={
          <>
          <div className="main-bg"></div>
          <div className="container">
            <div className="row">
              {/* <Card MG={MG[1]} i={1}></Card> 
              <Card MG={MG[2]} i={2}></Card>  */}
              {
                MG.map((a, i)=>{
                  return (
                    <Card MG={MG[i]} i={i}></Card> 
                  )
                })
              }
            </div>
          </div> 
          </>
        }/>
        <Route path="/detail" element={<div>상세페이지</div>}/>
        <Route />
      </Routes>
    </div>
  );
}

function Card(props) {
  return (
    <div className="col-md-4">
              <img src={process.env.PUBLIC_URL + '/images/mg' + (props.i+1) + '.jpg'}/>
              <p>{ props.MG.gundam_series }</p>
              <h5>{ props.MG.gundam_name}</h5>
              <h4>{ props.MG.price}</h4>
          </div>     
  );
}

export default App;
